import React,{useEffect,useState} from "react";

const DataFetching=(props)=>{
    const[cats,setcCats]=useState([])
    const apiUrl='https://aws.random.cat/meow';

    

    useEffect(()=>{
        fetch(apiUrl)
        .then(res=>res.json())
        .then(result=>{
            const {file}=result
            const nextCats=cats.concat(file)
            setcCats(nextCats)
            console.log("prev",cats, "finalstate",nextCats)
            console.log("file",file)
        });
        console.log("i mounted");
    },[])
    return(
        <p>i want to fetch data</p>
    )
}
export default DataFetching;
